import React from 'react'
import Banner from '../Components/Banner/Banner';
import CoinTable from '../Components/CoinTable';
const CoinsTable = React.lazy(()=> import('../Components/CoinTable'))

const HomePage = () => {
  return (
    <div>
    <Banner/>
    <CoinTable/>
    </div>
  )
}

export default HomePage
